  render() {
    return (
      <EnchereContext.Provider value="hello from context">
         {this.props.children}
      </EnchereContext.Provider>

        
      
    );
  }
}


const EnchereConsumer = EnchereContext.Consumer;

export { EnchereProvider,EnchereConsumer};
